    [],nt"revision_timestamp": "2015-09-26T21:16:55.391852",nt"name": "line-w-hydrography-including-pressure-temperature-salinity-dissolved-oxygen-and-dissolved-chlore5e10",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset represent one of a series
    of hydrographic sections conducted along Line W from the continental shelf south
    of New England toward Bermuda. A total of 54 full depth casts consisting of CTD
    (conductivity, temperature, pressure and oxygen), LADCP (lowered acoustic Doppler
    current profiler),and rosette water samples were collected between 04/30/2004 and
    05/05/2004. Salinity and dissolved oxygen were analyzed from water samples on board
    the ship and used to calibrate the CTD sensors. Water samples were also analyzed
    for transient tracers (CFCs 11, 12, 113).",nt"license_title": null,nt"extras":
